import React from 'react';

import TrashIcon from "../../icons/delete.svg"

// Components
import Nav from '../layout/Nav';
import Content from '../layout/Content';
import Footer from '../layout/Footer';

const Main = () => {
    return (
        <div className="App">
            <Nav />
            <Content />
            <Footer />
            <img src={TrashIcon} alt="delet" />
        </div>
    )
}

export default Main;
